/*
export default function Guess() {
  function handleClick() {
    let randomNum = Math.floor(Math.random() * 3) + 1;
    console.log(randomNum);
    let userInput = prompt("type a number");
    alert(`Computer number: ${randomNum}, Your guess: ${userInput}`);
    if (randomNum == userInput) {
      alert("Congratulation Baby");
    }
  }

  return <button onClick={handleClick}>Guess the number</button>;
}
*/
function Buttun({ onclick, children }) {
  return <Buttun onClick={onclick}>{children}</Buttun>;
}

function ToolBar({ onPlay, onApload }) {
  return (
    <>
      <Buttun onClick={onPlay} children="Play" />
      <Buttun onClick={onApload} children="abload" />
    </>
  );
}

export default function AppSS() {
  return (
    <ToolBar
      onApload={() => alert("Aploading")}
      onPlay={() => alert("Playing")}
    />
  );
}
